import React from "react";
import css from "../Layout/Navbar";

const Map = () => {
  return (
    <div class="container section negative-margin">
    <div class="row">
      <div class="col-sm-12">
        <div id="map"></div>
      </div>
    </div>
  </div>
  );
};

export default Map;
